import React from 'react';

const StationDetail = ({ station }) => {
  return(
    <div>
      <h3>`{station.name}:`</h3>
      <ul>
        <li>
          `{station.free_bikes} bicicletas libres`
        </li>
        <li>
          `{station.empty_slots} bicicletas usadas`
        </li>
        <li>
          `Actualizado hace {station.last_updated}`
        </li>
      </ul>
    </div>
  );
};

export default StationDetail;
